from functools import cache
@cache
def a(n):
    if n == 0: return 1
    cs = a(n-1)
    ca = min((a(i) + a(n-i) for i in range(1, n)), default=cs)
    cm = min((a(j) + a(n//j) for j in range(2, n) if n%j == 0), default=cs)
    return 1 + min(cs, ca, cm)
